delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `testProcedure`(in in_id INT,out out_min_id BIGINT,out total INT)
begin
select  min(id) from sys_menu
where id>in_id  into out_min_id;
select count(1) from sys_menu into total;
end
;;
delimiter ;

