INSERT INTO `doc_tpl_settings` VALUES (1840650177090793474, 1840650176918827010, '[]', '[]', '[{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"{{产品信息.产品名称}}产品\",\"size\":29,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"center\"}],\"level\":\"first\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"{{产品信息.年度}}第{{产品信息.季度}}季度资产管理报告\",\"size\":29,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"center\"}],\"level\":\"first\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" {{产品信息.公司名称}}\\n[产品托管人]\",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"产品管理人：{{产品信息.产品管理人}}\",\"size\":21,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"center\"},{\"value\":\"\\n\"},{\"value\":\"产品托管人：{{产品信息.产品托管人}}\",\"size\":21,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"center\"},{\"value\":\"\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"一、重要提示\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"second\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"tab\",\"rowFlex\":\"alignment\"},{\"value\":\"{{产品信息.产品管理人}}\",\"size\":21,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"（以下简称\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"{{产品信息.产品管理人}}\",\"size\":21,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"）保证本报告所载资料不存在虚假记载、误导性陈述或重大遗漏，并对其内容的真实性、准确性和完整性承担相关责任。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"tab\",\"rowFlex\":\"alignment\"},{\"value\":\"产品管理人承诺以诚实信用、谨慎勤勉的原则管理和运用产品资产，但不保证产品一定盈利，也不保证最低收益。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"tab\",\"rowFlex\":\"alignment\"},{\"value\":\"产品的过往业绩并不代表其未来表现。投资有风险，投资人在作出投资决策前应仔细阅读本产品的募集说明书。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"tab\",\"rowFlex\":\"alignment\"},{\"value\":\"{{产品信息.认购日期}}，本产品募集户内的认购资金总额达到{{产品信息.认购金额}}，认购成功的投资人{{产品信息.认购人数}}人，经天健会计师事务所北京分所对托管账户验资完毕并出具验资报告后，本产品符合《{{产品信息.产品名称}}合同》的成立条件。管理人于{{产品信息.发布日期}}发布《{{产品信息.产品名称}}成立公告》，产品于{{产品信息.成立日期}}设立。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"tab\",\"rowFlex\":\"alignment\"},{\"value\":\"本产品托管人为宁波银行股份有限公司，根据中国银保监会有关规定，有资格从事保险资产管理产品资产托管业务。本产品管理人与托管人签订了《{{产品信息.产品名称}}产品托管协议》，{{产品信息.产品托管人}}根据协议为产品资产提供资产保管、投资监督、资产清算、估值等服务，以确保本产品资产的安全，保护投资人的合法权益。本产品除开立了托管银行账户外，还开立了境内银行间债券交易结算账户，具体包括中央国债登记有限公司、上海清算所债券交易结算账户、交易所证券账户。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"本报告期中的财务数据未经审计。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"本报告期自{{产品信息.报告开始日}}起至{{产品信息.报告结束日}}止。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"二、产品基本要素\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"second\"},{\"value\":\"\\n\"},{\"value\":\"\\n\",\"type\":\"table\",\"trList\":[{\"height\":42,\"tdList\":[{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"产品名称\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]},{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"{{产品信息.产品名称}}\",\"size\":14,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]}],\"minHeight\":42},{\"height\":42,\"tdList\":[{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"产品代码\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]},{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"{{产品信息.产品代码}}\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]}],\"minHeight\":42},{\"height\":42,\"tdList\":[{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"产品类型\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]},{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"{{产品信息.产品类型}}\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]}],\"minHeight\":42},{\"height\":42,\"tdList\":[{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"产品设立日\",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]},{\"colspan\":1,\"rowspan\":1,\"value\":[{\"value\":\"{{产品信息.产品成立日}}\",\"size\":14,\"bold\":false,\"