,\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"七、2023年第四季度投资策略回顾及市场展望\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"second\"},{\"value\":\"\\n\"},{\"value\":\"固定收益投资部分：\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"    四季度债市利率整体呈现前期平坦、后期下行的态势，年底债市明显走强。十月，在税期走款及季末因素扰动下，资金面整体收敛，同时国债供给量显著回升，万亿国债增发落地，宽财政预期带动债市收益率整体震荡，十年期国债收益率上升至2.70%点位。进入十一月，前半月资金面转松、十月PMI重新回落，资金面和基本面均利好债市，同时万亿国债增发政策落地后，一定程度演绎利空出尽，市场宽货币预期升温，叠加特殊再融资债放量放缓等因素，十年国债利率再度下行至2.64%；后半月长端利率再次上行，一方面降准预期落空，另一方面宽地产政策出台，债市防御情绪再度增强，十年国债利率上行至2.71%。进入十二月，随着跨月后资金面较为宽松，市场对降准在内的宽货币政策仍有一定期待，市场情绪有所企稳，十年期国债收益率重新回落至2.55%附近。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"展望2024年，2023年末重要会议未见超预期刺激政策，短期看，财政发力预计仍较为谨慎，货币政策延续宽松，叠加地产刺激政策仍有待时间消化，“资产荒”行情仍将延续。多重影响下，债市预计将延续牛市行情，债券收益率存在进一步下行空间。长期看，随着政策效果逐步显现，债市不确定性将有所增加，收益率或存上行压力。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"本产品仍将在保持高流动性和严控信用风险的前提下，投资于各类型存款、存单，充分运用公司平台优势和团队交易对手资源，获取较好的资产价格，实现产品资产的稳健增值。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"权益投资部分：本产品投资范围不包括权益资产。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"八、\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false},{\"value\":\"管理人\",\"size\":21,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false},{\"value\":\"报告\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"second\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"8.1本产品投资风险情况\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"third\"},{\"value\":\"\\n\"},{\"value\":\"本报告期间，本管理人严格遵守《中华人民共和国保险法》《保险资金运用管理办法》《保险资产管理公司管理规定》及《关于规范金融机构资产管理业务的指导意见》《保险资产管理产品管理暂行办法》《组合类保险资产管理产品实施细则》等相关法律法规、监管规定以及产品合同的相关约定，依照诚实信用、勤勉尽责、安全高效的原则管理和运用产品资产，在严格控制投资风险的基础上，为产品份额持有人谋求最大利益，不存在损害产品份额持有人利益的情形。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"在本报告期内，本管理人按照公司风险管理政策和各项法规要求有序地开展工作，实时监控投资风险指标，做好投资限额、持仓比例、异常交易等风险监测及提示，积极防范投资业务各类风险。报告期内，各项风险监测指标无异常情况，整体风险可控，未发生重大风险合规事件。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"8.2 管理人对报告期内公平交易情况的专项说明\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"third\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"8.2.1 公平交易制度的执行情况\",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"fourth\"},{\"value\":\"\\n\"},{\"value\":\"本管理人一贯公平对待旗下管理的所有产品和组合，制定并严格遵守相应的制度和流程，通过系统和人工等方式在各环节严格控制交易公平执行。报告期间，本管理人严格执行了公平交易制度。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"8.2.2 异常交易行为的专项说明\",\"size\":18,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"fourth\"},{\"value\":\"\\n\"},{\"value\":\"报告期内未发现本产品存在异常交易行为。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"\",\"type\":\"title\",\"valueList\":[{\"value\":\"九、影响投资者决策的其他重要信息\",\"size\":21,\"bold\":true,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}],\"level\":\"second\"},{\"value\":\"\\n\"},{\"value\":\"本报告期内，未出现影响投资者决策的其他重要信息。\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\"永诚保险资产管理有限公司\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"right\"},{\"value\":\"\\n\"},{\"value\":\"XXXX年XX月XX日\",\"size\":18,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"},{\"value\":\" \",\"size\":14,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false,\"rowFlex\":\"alignment\"},{\"value\":\"\\n\"}]', '[]', 794, 1123, 'vertical', 1542700042843824129, '2024-09-30 15:09:35', 1542700042843824129, '2024-10-09 09:08:56', 1, NULL);
