INSERT INTO `doc_tpl_settings` VALUES (1847201518856540162, 1847201518814597121, '[]', '[]', '[{\"value\":\"【摘 要 题】青少年社会调查\\n【正 文】\\n     中国拥有世界上最为庞大的青少年人口群体。统计表明，2003年中国14~35 岁人口有 4.65 亿，占总人口的 36.25%。对于任何社会来说，青少年都是民族的未来与希望。中国社会正处于改革开放的时代，现在的青少年是变革的弄潮儿、受益者和风险承担者，他们正在经历着我国社会经济等方面的重大变革，发展变化的速度很快。客观、准确地了解和掌握青少年的现状，才能从实际出发，制定有效的政策，从而正确引导青少年，把青少年一代培养成为有理想、有道德、有文化、有纪律的社会主义新人。本报告主要是依据统计数据对近年来中国青少年发展状况进行分析，所采用的数据均为写本报告时(截至2005年7月31日)中国青少年发展状况指标体系中各项指标所能获得的最新数据。在本报告中青少年采用 14~29 岁和 14~35 岁两种年龄统计口径。\\n1、青少年人口分布状况\\n      人口的分布状况主要由地区构成和城乡构成两项指标来衡量。2000年第五次人口普查时，14~29 岁的青少年人口广东省为最多，达 2900万人，西藏最少，仅为82万人。各省市青少年占总人口的比重集中在 24.01~34.03%区间范围内，广东省比重最高，达34.03%，最低的为江苏省，占 24.01%。14~35 岁的青少年人口数分布与 14~29 岁的青少年人口数分布接近，比重略有差异。各省之间青少年人口差异与各省总人口和它们过去的生育率、死亡率、迁移率的变化都有密切关系。\\n\"},{\"value\":\"2、中年人口\",\"size\":16,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false},{\"value\":\"分布状况\\n\"},{\"value\":\"人口的分布状况主要由地区构成和城乡构成两项指标来衡量。2000年第五次人口普查时，14~29 岁的青少年人口广东省为最多，达 2900万人，西藏最少，仅为82万人。各省市青少年占总人口的比重集中在 24.01~34.03%区间范围内，广东省比重最高，达34.03%，最低的为江苏省，占 24.01%。14~35 岁的青少年人口数分布与 14~29 岁的青少年人口数分布接近，比重略有差异。各省之间青少年人口差异与各省总人口和它们过去的生育率、死亡率、迁移率的变化都有密切关系。\",\"size\":16,\"bold\":false,\"color\":\"rgb(0, 0, 0)\",\"italic\":false}]', '[]', 794, 1123, 'vertical', 1542700042843824129, '2024-10-18 17:02:16', 1542700042843824129, '2024-10-18 17:07:18', 1, NULL);
